    <Stack spacing={4} direction="column">
      <h1 style={{fontFamily: "roboto", color: "white"}}>Title</h1>
      <h3 style={{fontFamily: "roboto", color: "white"}}>Explanation</h3>
      <InputForm />
      <h3 style={{fontFamily: "roboto", color: "white"}}>Goodbye</h3>
    </Stack>
  );
}

export default App;
